type QueryExemplarsInput struct {
	Query     *flameql.Query
	StartTime time.Time
	EndTime   time.Time

	MinValue uint64
	MaxValue uint64

	HeatmapTimeBuckets  int64
	HeatmapValueBuckets int64
}

type QueryExemplarsOutput struct {
	Tree     *tree.Tree
	Count    uint64
	Heatmap  *Heatmap
	Metadata metadata.Metadata

	Telemetry map[string]interface{}
}

func (*Storage) QueryExemplars(_ context.Context, in QueryExemplarsInput) (QueryExemplarsOutput, error) {
	// FIXME(kolesnikovae): Not implemented.
	// Stub data for testing.

	// The heatmap includes 10m of sample data (~100K exemplars).
	// Note that the distribution of values is non-uniform:
	// most of the values are concentrated in the bottom Y-bin,
	// as exemplars typically include ver few samples (1-2).
	h := &Heatmap{
		TimeBuckets:  60,
		ValueBuckets: 32,
		StartTime:    time.Date(2022, time.August, 4, 21, 40, 0, 0, time.Local),
		EndTime:      time.Date(2022, time.August, 4, 21, 50, 0, 0, time.Local),
		MinValue:     1,
		MaxValue:     110,
		MinDepth:     1,
		MaxDepth:     23077,
		Values:       datasetA,
	}

	// If MaxValue was specified, we respond with another dataset:
	// original min-max: (18:50]
	if in.MaxValue > 0 {
		h.MinValue = 19
		h.MaxValue = 50
		h.MinDepth = 1
		h.MaxDepth = 21
		h.Values = datasetB
	}

	return QueryExemplarsOutput{Tree: tree.New(), Heatmap: h}, nil
}

